// home.jsx
import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './styles/home.css';

const Home = () => {
    const navigate = useNavigate();

    const handleCreateCompanyClick = () => {
        navigate('/create-company');
    };

    return (
        <div className="home-container">
            <h1>Customer</h1>
            <div className="company-section">
                <label htmlFor="company-search">Search for a company</label>
                <input type="text" id="company-search" placeholder="Company" />
                <button className="create-company-btn" onClick={handleCreateCompanyClick}>Create new company</button>
            </div>
            <div className="company-table">
                <table>
                    <thead>
                        <tr>
                            <th>Company name</th>
                            <th>Status</th>
                        </tr>
                    </thead>
                    <tbody>
                        {/* Ajoutez ici les donn√©es des entreprises */}
                    </tbody>
                </table>
            </div>
            <button className="download-btn" onClick={() => navigate('/documents')}>Download the documents</button>
        </div>
    );
};

export default Home;
